import React,{useState } from'react';
import axios from 'axios';
import http from '../http';

export default function Create() {
  const [inputs,setInputs] = useState({});
  const handleChange= (event) => {
        const name=event.target.name;
        const value=event.target.value;
        setInputs(values=>({...values,[name]:value}));
       }

  return (
  <div>
    <h2>New User</h2>
    <div className="row">
      <div className="col-md-6 justify-content-center">
        <div className="card p-4">
         <label>Name</label>
         <input type="text" name="name" className="form-control mb-2" placeholder="Enter Name" value={inputs.name || ''} onChange={handleChange}/>
         <label>Email</label>
         <input type="email" name="email" className="form-control mb-2" placeholder="Enter Email" />
         <label>Password</label>
         <input type="password" name="password" className="form-control mb-2" placeholder="Enter Password" />
         <button type="button" className="btn btn-info mt-2">Create</button>
      </div>
    </div>
    </div>
    </div>
)
}
